script: |
  super -f text -I q766.spq | sort > q766.out

inputs:
  - name: q766.spq
    data: |
      SELECT DISTINCT - col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( 19 * + - col2 ) BETWEEN col0 + + col1 - col2 AND col0;
  - name: tab1

outputs:
  - name: q766.out
    data: |
      -59
      -68
      -96
